import React from "react";

const youtube = "GAMERZAM";

const facebook = "Muhamamd Zaeem";

const pubg = "fortnite";

function Check() {
  return <h1>fortnite</h1>;
}

function Timerr() {
  let h = new Date();
  h = h.getHours();
  let f = <h9>Date : {h}</h9>;
  return f;
}

export default youtube;

export { facebook, pubg, Check, Timerr };
